import React from 'react';
import {BrowserRouter as Router, Route, Routes} from 'react-router-dom'
import Register from './auth/register'
import Login from './auth/login'

const App = () => {
  return (
    <Routes>
      <Route exact path="/" element={<Register/>} />
    </Routes>
  );
};

export default App;
